import React, { Component } from 'react';

class App extends Component {
  // state = { isLoggedIn: false, displays: [{ name: 'a' }, { name: 'b' }] };
  state = { isOn: false };

  toggle = () => {
    this.setState(prevState => ({ isOn: !prevState }));
  };

  render() {
    return (
      <div className="App">
        <h1>Heyy</h1>
        <div>
          <h1 className="display">Off</h1>
        </div>
        <div>
          <button onClick={this.toggle} className="toggle-btn">
            Toggle
          </button>
        </div>
      </div>
    );
  }
}

export default App;
